import React from 'react';
import ReactDOM from 'react-dom';
import './index.css'; // Certifique-se de que o CSS está sendo importado
import App from './App';

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root') // Certifique-se de que o ID corresponde ao div no index.html
);
